// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import FilmList from '/Users/hubertkowal/Documents/FilmTrackerApp/film-tracker-frontend/src/controller/FilmList.js';
import FilmForm from '/Users/hubertkowal/Documents/FilmTrackerApp/film-tracker-frontend/src/controller/FilmForm.js';

function App() {
    return (
        <Router>
            <div className="App">
                <Switch>
                    <Route exact path="/" component={FilmList} />
                    <Route path="/add" component={FilmForm} />
                    <Route path="/edit/:id" component={FilmForm} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
